import React from "react";
import "./Persons.css";
import Sidenav from "./Sidenav";
import { Button } from "@material-ui/core";

const url = "http://localhost:8080/persons";

export default function HomePage() {
    function showAll() {
        fetch(url + "/get/all",{
            method: "GET",
            headers: {
                "Content-Type": "application/json",
                Accept: "application/json",
            },
            body: JSON.stringify({
                "page": 0,
                "no_per_page": 10
            })
        })
            .then((res) => res.json())
            .then((data) => {
                console.log(data);
            });
    }
    return (
        <div className="HomePage">
            <Sidenav/>
            <main>
                <Button variant="contained" className="buttonPerson">Add new person</Button>
                <Button variant="contained" className="buttonPerson">Search by name</Button>
                <Button variant="contained" className="buttonPerson">Search by cnp</Button>
                <Button variant="contained" className="buttonPerson">Show all</Button>

            </main>
        </div>
    );
}
